define([], function() { return "<application-window data-id=\"DrawWindow\">\r\n\r\n  <gui-vbox>\r\n    <!-- MENU BAR -->\r\n    <gui-vbox-container data-grow=\"0\" data-shrink=\"1\" data-basis=\"auto\">\r\n      <gui-menu-bar>\r\n\r\n        <gui-menu-bar-entry data-label=\"LBL_FILE\">\r\n          <gui-menu data-id=\"SubmenuFile\">\r\n            <gui-menu-entry data-id=\"MenuNew\" data-label=\"LBL_NEW\"></gui-menu-entry>\r\n            <gui-menu-entry data-id=\"MenuOpen\" data-label=\"LBL_OPEN\"></gui-menu-entry>\r\n            <gui-menu-entry data-id=\"MenuSave\" data-label=\"LBL_SAVE\"></gui-menu-entry>\r\n            <gui-menu-entry data-id=\"MenuSaveAs\" data-label=\"LBL_SAVEAS\"></gui-menu-entry>\r\n            <gui-menu-entry data-id=\"MenuClose\" data-label=\"LBL_CLOSE\"></gui-menu-entry>\r\n          </gui-menu>\r\n        </gui-menu-bar-entry>\r\n\r\n      </gui-menu-bar>\r\n    </gui-vbox-container>\r\n\r\n    <!-- CONTENT -->\r\n    <gui-vbox-container data-grow=\"1\" data-shrink=\"0\" data-basis=\"auto\" data-fill=\"true\">\r\n\r\n      <gui-hbox class=\"gui-no-overflow\">\r\n        <gui-hbox-container data-id=\"Toolbar\">\r\n          <gui-toolbar data-orientation=\"vertical\" style=\"text-align:center\">\r\n            <gui-color-box data-id=\"Foreground\"></gui-color-box>\r\n            <gui-color-box data-id=\"Background\"></gui-color-box>\r\n            <gui-button data-id=\"tool-pointer\" data-group=\"tool\" data-tool-name=\"pointer\" data-icon=\"icons/stock-cursor-16.png\"></gui-button>\r\n            <gui-button data-id=\"tool-picker\" data-group=\"tool\" data-tool-name=\"picker\" data-icon=\"icons/stock-color-pick-from-screen-16.png\"></gui-button>\r\n            <gui-button data-id=\"tool-bucket\" data-group=\"tool\" data-tool-name=\"bucket\" data-icon=\"icons/stock-tool-bucket-fill-16.png\"></gui-button>\r\n            <gui-button data-id=\"tool-pencil\" data-group=\"tool\" data-tool-name=\"pencil\" data-icon=\"icons/stock-tool-pencil-16.png\"></gui-button>\r\n            <gui-button data-id=\"tool-path\" data-group=\"tool\" data-tool-name=\"path\" data-icon=\"icons/stock-tool-path-16.png\"></gui-button>\r\n            <gui-button data-id=\"tool-rectangle\" data-group=\"tool\" data-tool-name=\"rectangle\" data-icon=\"icons/stock-shape-square-16.png\"></gui-button>\r\n            <gui-button data-id=\"tool-circle\" data-group=\"tool\" data-tool-name=\"circle\" data-icon=\"icons/stock-shape-circle-16.png\"></gui-button>\r\n\r\n            <gui-button data-group=\"tool\" data-tool-name=\"cursor\" data-icon=\"icons/stock-cursor-16.png\" style=\"visibility:hidden;pointer-events:none\"></gui-button>\r\n          </gui-toolbar>\r\n        </gui-hbox-container>\r\n\r\n        <gui-hbox-container data-shrink=\"0\" data-grow=\"1\" data-fill=\"true\">\r\n\r\n          <gui-vbox>\r\n            <!-- TOOL BAR -->\r\n            <gui-vbox-container data-grow=\"0\" data-shrink=\"1\" data-basis=\"auto\">\r\n              <gui-toolbar data-id=\"TopToolbar\">\r\n\r\n                <gui-label>Line join</gui-label>\r\n                <gui-select data-id=\"LineJoin\">\r\n                  <gui-select-option data-value=\"round\">Round</gui-select-option>\r\n                  <gui-select-option data-value=\"miter\">Miter</gui-select-option>\r\n                  <gui-select-option data-value=\"bevel\">Bevel</gui-select-option>\r\n                </gui-select>\r\n\r\n                <gui-label>Line width</gui-label>\r\n                <gui-select data-id=\"LineWidth\">\r\n                </gui-select>\r\n\r\n                <gui-checkbox data-id=\"LineStroke\" data-label=\"Enable stroke\"></gui-checkbox>\r\n\r\n              </gui-toolbar>\r\n            </gui-vbox-container>\r\n            <gui-vbox-container data-grow=\"1\" data-shrink=\"0\" data-basis=\"auto\" data-fill=\"true\" data-id=\"ScrollContainer\">\r\n              <gui-scroll-container data-id=\"ScrollView\">\r\n                <gui-canvas data-id=\"Canvas\">\r\n                </gui-canvas>\r\n              </gui-scroll-container>\r\n            </gui-vbox-container>\r\n          </gui-vbox>\r\n        </gui-hbox-container>\r\n      </gui-hbox>\r\n\r\n    </gui-vbox-container>\r\n\r\n    <!-- STATUSBAR -->\r\n    <gui-vbox-container data-grow=\"0\" data-shrink=\"1\" data-basis=\"auto\">\r\n      <gui-statusbar data-id=\"Statusbar\"></gui-statusbar>\r\n    </gui-vbox-container>\r\n\r\n  </gui-vbox>\r\n\r\n\r\n</application-window>\r\n"; });